From this image, return json that has field list is the list of information (hand written text) that each element has field name is the name of player, score is the list of all scores of that player in format like this. The golf score is calculated like this, they hasve 9 front and 9 back scores. Remember that the each score would be from 0-9 but after 9 digits, which mean the 10th element is the sum of the last 9 scores, and the 20th element will be the sum of hole 11 to 19. for example the score will be [0, 1, 2, 1, 3, 2, 0, 0, 1, 11][{"golf": [{"name": "", "score": []}, {"name": "", "score": []}]These are examples: ```json
[
    {
        "golf": [
            {"name": "T Anh", "score": [2, 3, 1, 1, 2, 1, 1, 0, 3, 14]},
            {"name": "Tấn", "score": [1, 0, 1, 1, 0, 1, 2, 2, 2, 10]},
            {"name": "A Phúc", "score": [1, 0, 2, 1, 1, 2, 2, 2, 2, 13]},
            {"name": "A Tuấn", "score": [2, 0, 1, 0, 0, 4, 3, 1, 4, 15]}
        ]
    }
]
```or ```json
[
    {
        "golf": [
            {"name": "C Ngân", "score": [2, 4, 3, 2, 2, 1, 1, 1, 2, 18]},
            {"name": "C Ngân", "score": [2, 2, 1, 4, 0, 2, 2, 2, 2, 17]}
        ]
    }
]
```

